import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary" id="nav-items" >
      <a className="navbar-brand" className="nav-items" href="/">
        Search
      </a><span></span>
      <a className="navbar-brand" className="nav-items" href="/saved">
        Saved
      </a>
    </nav>
  );
}

export default Nav;
